import React from "react";
import { ProfileCard } from "./Components/card";
import { 
    MDBCard,
    MDBCardBody,
    MDBContainer,
    MDBRow,
    MDBCol,
 } from "mdb-react-ui-kit";
 import "./style.css";
import { TableSection } from "./Components/tableSection";
export function Trello(event) {

    const dataForDream = [
        <ProfileCard id= {1} countryName="France" cardPicUrl={"https://www.worldometers.info/img/flags/fr-flag.gif"} />,
        <ProfileCard id= {2} countryName="Netherlands" cardPicUrl={"https://www.worldometers.info/img/flags/nl-flag.gif"}/>,
        <ProfileCard id= {3} countryName="Belgium" cardPicUrl={"https://www.worldometers.info/img/flags/be-flag.gif"}/>
    ]
    const dataForBest = [
        <ProfileCard countryName="United State Of America" cardPicUrl={"https://www.worldometers.info/img/flags/us-flag.gif"} />,
    ]
    const dataForGood = [
        <ProfileCard countryName="Spain" cardPicUrl={"https://www.worldometers.info/img/flags/sp-flag.gif"} />,
        <ProfileCard countryName="UK" cardPicUrl={"https://www.worldometers.info/img/flags/uk-flag.gif"}/>,
        <ProfileCard countryName="Germany" cardPicUrl={"https://www.worldometers.info/img/flags/gm-flag.gif"}/>,
        <ProfileCard countryName="Canada" cardPicUrl={"https://www.worldometers.info/img/flags/ca-flag.gif"}/>,
        <ProfileCard countryName="Sweden" cardPicUrl={"https://www.worldometers.info/img/flags/sw-flag.gif"}/>,
        <ProfileCard countryName="Ireland" cardPicUrl={"https://www.worldometers.info/img/flags/ei-flag.gif"}/>

    ]
    const dataForIntermediate = [
        <ProfileCard countryName="Chile" cardPicUrl={"https://www.worldometers.info/img/flags/ci-flag.gif"} />,
        <ProfileCard countryName="Croatia" cardPicUrl={"https://www.worldometers.info/img/flags/hr-flag.gif"}/>,
        <ProfileCard countryName="Greece" cardPicUrl={"https://www.worldometers.info/img/flags/gr-flag.gif"}/>
    ]
    const dataForEvil = [
        <ProfileCard countryName="Turkey" cardPicUrl={"https://www.worldometers.info/img/flags/tu-flag.gif"} />,
        <ProfileCard countryName="Afgansitan" cardPicUrl={"https://www.worldometers.info/img/flags/af-flag.gif"}/>,
        <ProfileCard countryName="Iran" cardPicUrl={"https://www.worldometers.info/img/flags/ir-flag.gif"}/>
    ]


    const trello = {
       first: ["Dream", "Best", "Good", "Intermediate", "Evil"],
       second : [dataForDream, dataForBest, dataForGood, dataForIntermediate, dataForEvil]
    }
    const dropContainer = document.getElementById("dropContainer");

    dropContainer.addEventListener("dragover", dragOver);
    dropContainer.addEventListener("drop", drop);


    function drop(event) {
        // Get the card's ID from the dataTransfer object
        const cardId = event.dataTransfer.getData("text/plain");

        // Append the card to the drop container
        const card = document.getElementById(cardId);
        event.target.appendChild(card);
    }


    return(
        <>  
            <div className="trello-container">
                <MDBRow className="trello-content" id="dropContainer">
                    {
                        trello.first.map((titles, i) => {
                            return (
                                <MDBCol  onDragOver={(e) => e.preventDefault()} key={i} id={i} >
                                    <TableSection tableTitle={titles} data={trello.second[i]}></TableSection>
                                </MDBCol>
                            )
                        })
                    }
                </MDBRow>
            </div>
        </>



    )
}
